<template v-once>
  <div id="all-container" class="all-container">
    <div class="nav-category">
          <ul class="nav j-nav">
                <li class="nav-li" v-for="s in menuList" v-bind:key="s.id">
                  <a href="javascript:void(0);" class="nav-a" @click="getCurrent(s.id)"><span class="nav-a-text">{{s.text}}</span></a>
                </li>
              </ul>
        </div>
    <div id="content-wrap" class="content-wrap"  >
      <div class="life-module">
        <!--产品-->
        <div class="life-goodsAll">
            <!-- <div class="life-goodsBox" v-for="item in allData"> -->
          <div style="padding: 15px;">
           <img class="title-image" v-lazy="tempImg" >
           </div>
            <div class="life-goodsTip">
              <p class="life-goodsMark">-{{currentCategory.Name}}-</p>
              <p v-if="currentCategory.CategoryTag != null">{{currentCategory.CategoryTag}}</p>
            </div>
            <ul class="life-goodsUl clearFix onlyStyle">
             <li v-for="child in currentCategory.Children"> 
              <a tag="li" @click="toItem(child)">
                <img v-lazy="cdnRUL+child.Icon" >
                <p>{{child.Name}}</p>
              </a>
              </li> 
            </ul>
          <!-- </div> -->
        </div>
      </div>
    </div>
</div>
</template>
<script>
import Vue from "vue";
var search_key = null;

export default {
  name: "all",
  data() {
    return {
      cdnRUL: "http://i1.lifevccdn.com/",
      allData: [],
      inputVal: "",
      rearchResult: [],
      rearchResultState: false,
      isChange: false,
      showloading: false,
      currentCategory: {},
      menuList: [
      ],
      tempImg:dd,
    };
  },
  methods: {
    toItem(item){
      // debugger;
            var u = navigator.userAgent;
            var isAndroid = u.indexOf('Android') > -1 || u.indexOf('Adr') > -1; //android终端
            var isiOS = !!u.match(/\(i[^;]+;( U;)? CPU.+Mac OS X/); //ios终端
            var obj={
              'id':item.ItemIndexId,
              'title':item.Name,
            }
            if (isAndroid) {
                window.OCmodel.gotoItem(obj);//调用原生方法
            }
            if (isiOS) {
                OCmodel.gotoItem(obj);//调用原生方法
            }
    },
    getCurrent(id){
      console.log(id);
      var arr =this.allData
      for(let i=0 ;i<arr.length;i++){
      if(arr[i].ItemIndexId==id)
      {
        this.currentCategory = arr[i]
      }
    }
      
    },
    getCategoryNav(arr){
    let list = [];
    for(let i=0 ;i<arr.length;i++){
      var obj={};
      obj['id']=arr[i].ItemIndexId;
      obj['text']=arr[i].Name;
      list.push(obj);
    }
    return list;
    }
  },
  beforeDestroy() {},
  created() {
    var self = this;
    self.showloading = true;
    self.inputVal = "";
    function getAllCategory() {
      return new Promise((resolve, reject) => {
        var url =
          "http://app.lifevc.com/1.0/v_h5_5.1.2_33/categories/allCategory";
        self.$http.get(url).then(
          function(result) {
            resolve(result);
          },
          function(error) {
            reject(error);
          }
        );
      });
    }
    getAllCategory().then(
      function(result) {
        
        self.allData = result.body.InnerData;
        self.menuList=self.getCategoryNav(self.allData)
        self.showloading = false;
        console.log(self.allData);
        self.currentCategory=self.allData[0];
      },
      error => {
        self.showloading = false;
      }
    );
    this.$nextTick(function() {});
  },
  mounted() {}

  // directives: {
  //   liHeight: {
  //     inserted: function (el) {
  //       var liH = Math.floor($(window).width() / 3 / 0.9);
  //       $(el).height(liH);
  //     }
  //   }
  // }
};

var dd='data:image/png;base64,'
</script>
